const consultaListarTodosAgotados = `SELECT * FROM Producto WHERE cantidadExistencia < 1`;
const consultaListarTodosByCategoria = `SELECT * FROM Producto WHERE Producto.categoria LIKE '%' + @categoria + '%'`;
